import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background-color: black;
  color: white;
  padding: 20px;
  width: 100%;
  position: fixed;
  bottom: 0;
  left: 0;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Footer = () => {
  return (
    <FooterContainer>
      <div>
        <p style={{ marginRight: '20px' }}>Terms of use</p>
        <p style={{ marginRight: '20px' }}>Privacy policy</p>
        <p>Contact us</p>
      </div>
      <p>&copy; 2024 FitnessTrack. All rights reserved.</p>
    </FooterContainer>
  );
};

export default Footer;
